// src/pages/Cliente/ClienteHome.jsx
import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import api from '../../services/api';

export default function ClienteHome() {
  const navigate = useNavigate();
  const [dono, setDono] = useState(null);
  const [meusPets, setMeusPets] = useState([]);
  const [meusEventos, setMeusEventos] = useState([]);
  const donoId = localStorage.getItem('donoId');

  useEffect(() => {
    if (!donoId) {
      navigate('/login-cliente');
      return;
    }
    async function loadData() {
      try {
        // Buscar dados do dono
        const resDono = await api.get(`/donos/${donoId}`);
        setDono(resDono.data);

        // Pets do dono
        const pets = resDono.data.pets || [];
        setMeusPets(pets);

        // Buscar eventos de cada pet
        const eventosPorPet = await Promise.all(
          pets.map(idPet => api.get(`/eventos/pet/${idPet}`))
        );
        // Flatten e ordenar por dataEntrada desc
        const allEventos = eventosPorPet
          .flatMap(r => r.data)
          .sort((a, b) => new Date(b.dataEntrada) - new Date(a.dataEntrada));
        setMeusEventos(allEventos);
      } catch {
        navigate('/login-cliente');
      }
    }
    loadData();
  }, [donoId, navigate]);

  if (!dono) return <p>Carregando...</p>;

  const formatDate = iso => new Date(iso).toLocaleString('pt-BR');

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Painel do Cliente</h2>
        <button
          className="btn btn-secondary"
          onClick={() => {
            localStorage.clear();
            navigate('/login-cliente');
          }}
        >
          Sair
        </button>
      </div>

      <div className="row">
        {/* Perfil do dono */}
        <div className="col-md-4">
          <div className="card mb-4">
            <div className="card-header bg-white border-0">
              <h5 className="mb-0">Meus Dados</h5>
            </div>
            <ul className="list-group list-group-flush">
              <li className="list-group-item"><strong>Nome:</strong> {dono.nome}</li>
              <li className="list-group-item"><strong>E-mail:</strong> {dono.email}</li>
              <li className="list-group-item"><strong>CPF:</strong> {dono.cpf}</li>
              <li className="list-group-item"><strong>Telefone:</strong> {dono.telefone}</li>
              <li className="list-group-item"><strong>Endereço:</strong> {dono.endereco}</li>
            </ul>
          </div>

          <div className="card">
            <div className="card-header bg-white border-0">
              <h5 className="mb-0">Meus Pets</h5>
            </div>
            <ul className="list-group list-group-flush">
              {meusPets.length === 0 && (
                <li className="list-group-item">Nenhum pet cadastrado.</li>
              )}
              {meusPets.map(petId => (
                <li key={petId} className="list-group-item">
                  <Link to={`/pets/${petId}`} className="text-decoration-none">
                    Ver pet #{petId}
                  </Link>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {/* Eventos do cliente */}
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-white border-0">
              <h5 className="mb-0">Meus Eventos</h5>
            </div>
            <ul className="list-group list-group-flush">
              {meusEventos.length === 0 && (
                <li className="list-group-item">Nenhum evento registrado.</li>
              )}
              {meusEventos.map(evt => (
                <li key={evt._id} className="list-group-item mb-2">
                  <div><strong>{evt.tipo}</strong></div>
                  <div>Entrada: {formatDate(evt.dataEntrada)}</div>
                  <div>Status: {evt.status || (evt.dataSaida ? 'Concluído' : 'Ativo')}</div>
                  {evt.observacoes && <div><em>Obs:</em> {evt.observacoes}</div>}
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}
